import React, { Component } from 'react';
import './App.css';
import API from "./utils/API";

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {};
  }

  componentDidMount() {
    this.getData()
  }

  componentWillUnmount() {
  }

  getData() {
    API.get().then(response => {
      this.setState(response.data)
    })
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">TESTESTE
        </header>
      </div>
    );
  }
}

export default App;
